1. We have a $3 \times n$ grid, which means there are 3 rows and $n$ columns.
2. There are 70 squares in total.
3. We need to find the value of $n$.

Let's consider the different sizes of squares that can be formed in the grid:

- 1x1 squares: These squares are formed by connecting adjacent points. In a $3 \times n$ grid, there are $(n-1) \times (n-1)$ 1x1 squares.
- 2x2 squares: These squares are formed by connecting four adjacent points. In a $3 \times n$ grid, there are $(n-2) \times (n-2)$ 2x2 squares.
- 3x3 squares: These squares are formed by connecting nine adjacent points. In a $3 \times n$ grid, there are $(n-3) \times (n-3)$ 3x3 squares.

Now, let's set up an equation using the total number of squares:

$(n-1)^2 + (n-2)^2 + (n-3)^2 = 70$

Expanding the equation:

$n^2 - 2n + 1 + n^2 - 4n + 4 + n^2 - 6n + 9 = 70$

Combining like terms:

$3n^2 - 12n + 14 = 70$

Subtracting 70 from both sides:

$3n^2 - 12n - 56 = 0$

Now, we need to solve this quadratic equation for $n$. We can use the quadratic formula:

$n = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}$

In our equation, $a = 3$, $b = -12$, and $c = -56$. Plugging these values into the formula:

$n = \frac{12 \pm \sqrt{(-12)^2 - 4(3)(-56)}}{2(3)}$

$n = \frac{12 \pm \sqrt{144 + 672}}{6}$

$n = \frac{12 \pm \sqrt{816}}{6}$

$n = \frac{12 \pm 28}{6}$

We have two possible solutions:

$n_1 = \frac{12 + 28}{6} = 7$

$n_2 = \frac{12 - 28}{6} = -\frac{16}{6} = -\frac{8}{3}$

Since $n$ represents the number of columns in the grid, it must be a positive integer. Therefore, the only valid solution is $n = 7$.

So, the final answer is \boxed{7}.

The answer is: 7.

